function getCountryFlag(isoCode) {
    if (isoCode.length !== 2) {
        return 'Invalid ISO code';
    }

    const OFFSET = 127397;
    const countryCode = isoCode.toUpperCase();

    let flag = '';
    for (let i = 0; i < countryCode.length; i++) {
        flag += String.fromCodePoint(countryCode.charCodeAt(i) + OFFSET);
    }

    return flag;
}
